import React from "react";
import "./Ellipse4.css";

function Ellipse4() {
  return (
    <div className="ellipse-4">
      <img
        className="icon-musical_note"
        src="https://anima-uploads.s3.amazonaws.com/projects/6492c55c74995fc792d0df14/releases/6493fbc959e3e5a943ada352/img/ion-musical-notes.svg"
        alt="icon-musical_note"
      />
    </div>
  );
}

export default Ellipse4;
